
import base64
import sys

# --- Tahap 1: Deobfuscator Tanpa Kunci dengan Looping ---

ENCODED_PAYLOAD = r""""""
LOOP_COUNT = 10
OFFSET = 10

def reverse_operation(payload_b64: str, loops: int, off: int) -> str:
    try:
        data_bytes = base64.b64decode(payload_b64)
        
        # Balikkan operasi looping
        for _ in range(loops):
            data_bytes = bytes([(b - off + 256) % 256 for b in data_bytes])
            
        return data_bytes.decode('utf-8')
    except Exception as e:
        print(f"Error saat deobfuscation awal: {e}. File mungkin rusak.")
        sys.exit(1)

next_stage_code = reverse_operation(ENCODED_PAYLOAD, LOOP_COUNT, OFFSET)

exec(next_stage_code)
